import React from "react";

function App() {
  const style = {
    padding: "100px",
    // display:flex : flex박스 모델에 따라 자식들을 정렬해라는 설정
    display: "flex",
    // flex로 정렬된 요소들에 12px만큼의 간격을 부여하겠다라는 뜻
    gap: "12px",
  };

  const squareStyle = {
    width: "100px",
    height: "100px",
    border: "1px solid green",
    borderRadius: "10px",
    // flex 박스 속성에는 alignItem과 justifyContent속성이 있음
    display: "flex",
    //alignItems : 열의 위치를 설정하는 속성
    alignItems: "center",
    // justifyContent : 행의 위치를 설정하는 속성
    justifyContent: "center",
  };

  return (
    <div style={style}>
      <div style={squareStyle}>감자</div>
      <div style={squareStyle}>고구마</div>
      <div style={squareStyle}>호박</div>
      <div style={squareStyle}>단호박</div>
      <div style={squareStyle}>알밤</div>
    </div>
  );
}

export default App;
